MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "Use this Quickstart chapter to learn the purpose of CalibreOPCverify and to understand how to use it effectively.");
MGCAddSnippet(5, "Calibre OPCverify is a grid-based optical process simulator and OPC results verification tool that is designed to predict a manufacturing process window for wafer contours. It supports the industry-standard OPC usage models and seamlessly integrates with other Siemens EDA tools.");
MGCAddSnippet(6, "Use the following table to quickly understand the basics of Calibre OPCverify.");
MGCAddSnippet(7, "The command descriptions use font properties and several metacharacters to document the command syntax.");
MGCAddSnippet(8, "The following sections describe key concepts to understanding Calibre OPCverify.");
MGCAddSnippet(9, "Calibre OPCverify command setup files are text files. They contain two types of statements: configuration commands and setlayer commands. ");
MGCAddSnippet(10, "Each setlayer command creates a context layer that can be used in subsequent setlayer commands. At least one context layer should be used as a derived output layer back to the SVRF file. ");
MGCAddSnippet(11, "Most users of Calibre OPCverify will probably utilize the following verification control operations. ");
MGCAddSnippet(12, "The SVRF rule file uses the same syntax as a Calibre nmDRC rule file. It must include a LITHO OPCVERIFY operation.");
MGCAddSnippet(13, "Running Calibre OPCverify requires the following items:");
MGCAddSnippet(14, "Calibre OPCverify is fully integrated with the complete set of Calibre RET tools. CalibrenmOPC and Calibre OPCverify provide dense OPC and OPC verification capabilities in an integrated flow. Together with CalibrenmDRC, CalibreOPCsbar, and Calibre FRACTURE, a complete hierarchical post-tapeout flow can be built on the Calibre platform.");
MGCAddSnippet(15, "Calibre OPCverify is supported as a part of the Calibre FullScale platform. While most setlayer commands support Calibre FullScale, there are some restrictions and limitations with the current release.");
MGCAddSnippet(16, "Calibre OPCverify may be best understood by examining sample applications that highlight some of the best practices for OPC verification.");
MGCAddSnippet(17, "Calibre OPCverify can detect both near-bridging conditions (soft bridging) and bridging conditions (where two contour edges touch) using the bridge command.");
MGCAddSnippet(18, "Bridging checks can also be created using a tolerance method.");
MGCAddSnippet(19, "Pinching checks look for errors in printed contours where two contour edges have near-gaps (soft pinching) or gaps (hard pinching) where they should not. Use the pinch command to detect pinching problems.");
MGCAddSnippet(20, "Building a pinching check using the tolerance method is similar to creating a bridging check using a tolerance zone.");
MGCAddSnippet(21, "An important use of Calibre OPCverify is to perform CD checks for gates. You can create a CD gate check using the following flow:");
MGCAddSnippet(22, "Calibre OPCverify can quickly simulate contours for variations of several different properties.");
MGCAddSnippet(23, "We can quickly simulate contours for misaligned masks in a double exposure process. This is accomplished with a simple variation of the setup file from the previous example. For brevity, only the setlayer image commands are shown here.");
MGCAddSnippet(24, "Calibre OPCverify contains operations that create process windows. Calibre WORKbench contains a tool that displays process windows. This application shows an example of how to use them together.");
MGCAddSnippet(25, "In this chapter, you will learn how to set up and run Calibre OPCverify in batch command mode. Using this chapter requires knowledge of SVRF commands and DRC rule file creation.");
MGCAddSnippet(26, "The usage model for Calibre OPCverify requires you to follow a specific flow.");
MGCAddSnippet(27, "Calibre OPCverify uses a specific setup file (in ASCII text) that contains a block of configuration parameters and operations that you want Calibre OPCverify to perform. It is not the same as the setup file used by Calibre WORKbench; you will be calling this file exclusively from Calibre OPCverify.");
MGCAddSnippet(28, "A design file consists of one or more named and numbered  layers,  which represent polygons in a topographical fashion. Layers can also be OPC correction layers, SRAF layers, or other non-printing layers (such as for text information). ");
MGCAddSnippet(29, "You use the SVRF rule file as input to Calibre. These instructions assume that you understand the basic construction of a rule file; the instructions in this section only detail the additional information you will need to run Calibre OPCverify as a Calibre LITHO command.");
MGCAddSnippet(30, "Concurrency mechanisms allow Calibre to complete operations faster by taking advantage of operations that can be run independently.");
MGCAddSnippet(31, "Topographical Models (also referred to as  topo models ) are extended optical models. They incorporate the effects of optical reflections from underlying layer topography. Most commonly, they are used in imaging of implant layers, where the reflective properties of underlying features (silicon, polysilicon) differ significantly from the properties of oxide on field area.");
MGCAddSnippet(32, "Use the correct syntax for topographical model files in order to get the best results.");
MGCAddSnippet(33, "Calibre OPCverify setup files must be modified to include awareness of topo models. The instructions assume that you have not created a litho model.");
MGCAddSnippet(34, "Modifying Calibre OPCverify code to include awareness of topo models contained in a litho model requires several steps to work with the pointers inside the litho model.");
MGCAddSnippet(35, "The Calibre OPCverify setup file supports Tcl script constructs. You can use conditional and looping Tcl code to simplify the setup and SVRF code for Calibre OPCverify. All lines in the setup file are evaluated at the beginning of the Calibre OPCverify job for Tcl code, and are converted to the raw commands. ");
MGCAddSnippet(36, "The following questions and answers may be useful to new users of Calibre OPCverify.");
MGCAddSnippet(37, "Calibre OPCverify is a command language that has an extensive set of setup commands and operations. ");
MGCAddSnippet(38, "Certain layer operations are measurement-oriented and therefore carry constraints. Constraints are intervals of non-negative real numbers; input data that falls within the specified constraint of an operation is generally output data. ");
MGCAddSnippet(39, "Several Calibre OPCverify commands can write out properties to an RDB database. Results of such OPCverify checks that have this additional information are viewable in Calibre RVE. Command parameters that control the output of these properties are placed in the Error-Centric section after the other command parameters.");
MGCAddSnippet(40, "The error-centric section consists of one or more  blocks , each of which is self-contained using braces ({}). ");
MGCAddSnippet(41, "Calibre OPCverify properties are floating point numbers representing additional information attached to error polygons. ");
MGCAddSnippet(42, "If a Calibre OPCverify output layer has a properties block, then a standard call to Calibre OPCverify returns a derived layer with properties. These properties can be manipulated with DFM PROPERTY commands, saved in an OASIS or a GDSII file with a DRC CHECK MAP command, or written to an RDB file with a DFM RDB command.");
MGCAddSnippet(43, "An OPCverify classification block is an extension to some of the Calibre OPCverify commands, allowing you to classify the filtered results of the command. It can be used in conjunction with a property function block, but is mutually exclusive with histogram and limit blocks.");
MGCAddSnippet(44, "Calibre OPCverify commands can return large amounts of results, especially for bigger, more complex chip designs. In such cases, you can optionally add a limit restriction to return only the worst subset of error polygons to the SVRF rule file. You use limit blocks as a safety net to avoid excessive error generation times due to variations in the layout. A limit is based off of one property function, a number of errors to return, and a selection criteria (smallest or largest value for the property). ");
MGCAddSnippet(45, "A histogram block adds the ability to save tabular data from properties to a file. It can be added to any command that also has a properties block. Histogram blocks are mutually exclusive with classify and limit blocks.");
MGCAddSnippet(46, "An add_properties block computes additional properties for the errors generated by other checks (such as pinch and bridge). These properties are computed relative to the locations where the primary check found a problem.");
MGCAddSnippet(47, "Pinpoint output markers can be placed at the  worst  part of an error marker location. Pinpoint output blocks are an option for any command that supports add_property blocks.");
MGCAddSnippet(48, "Use these steps to create a Calibre OPCverify command file and one or more LITHO OPCVERIFY calls for use in an SVRF rule file. ");
MGCAddSnippet(49, "Runs the Litho OPCverify tool on the specified command file. ");
MGCAddSnippet(50, "The litho model consolidates all of the model and mask information into a single object in order to define a manufacturing technology configuration. It is intended to unify simulation conditions across Calibre tools to reduce the possibility of errors.");
MGCAddSnippet(51, "The ZPlanes model describes resist 3D profiles for applications which require additional model parameters to match metrology or observed results. ");
MGCAddSnippet(52, "An EUV through-slit litho model is an extended form of a litho model that supports multiple DDM and optical models (referred to as sub-litho models) at multiple x-coordinates in the EUV field.");
MGCAddSnippet(53, "Loads a non-SVRF file into an SVRF rule file. Use this command to load a gauge file into SVRF for use in Calibre OPCverify.");
MGCAddSnippet(54, "The Calibre OPCverify tool has a set of built-in Lint checks that are run on the setup command file. The Lint checker reports settings that are not necessarily errors, but might be a misuse of options or might give suboptimal quality results. Lint warnings are reported in the Calibre OPCverify transcript.");
MGCAddSnippet(55, "The cmdfile argument to LITHO OPCVERIFY specifies a file (or an inline file) containing a case-sensitive command initialization block consisting of commands, specified one per line in roughly the order shown.");
MGCAddSnippet(56, "Defines the background transmission values of the mask for each exposure for a Calibre OPCverify command file.");
MGCAddSnippet(57, "Defines an options set that overrides one or more parameters of an EUV black border model inside a litho model for an image command.");
MGCAddSnippet(58, "Sets default values for classification blocks as an ease of use utility.");
MGCAddSnippet(59, "Sets the type of transformed call placements.");
MGCAddSnippet(60, "Computes frame processing statistics for Calibre OPCverify.");
MGCAddSnippet(61, "Specifies the contouring style used by Calibre OPCverify for any image and Calibre nmOPC denseopc commands in this setup command file. ");
MGCAddSnippet(62, "Sets new default critical dimension values for multiple commands. ");
MGCAddSnippet(63, "Loads a DDM model into Calibre OPCverify.");
MGCAddSnippet(64, "Enables direct data entry (DDE) in Calibre OPCverify.");
MGCAddSnippet(65, "Enables direct data output of OASIS files. Used with litho-flat configurations only.");
MGCAddSnippet(66, "Instructs Calibre OPCverify to output interim layers during a simulation. ");
MGCAddSnippet(67, "Describes the grid size for etch model simulation purposes.");
MGCAddSnippet(68, "Loads the specified etch model in Calibre OPCverify.");
MGCAddSnippet(69, "Specifies the center of a EUV field.");
MGCAddSnippet(70, "Sets a placement x-coordinate for EUV through-slit models. ");
MGCAddSnippet(71, "Designates a user-defined input_layer as a filter layer. ");
MGCAddSnippet(72, "Sets the upsampling from the resist grid to the final grid.");
MGCAddSnippet(73, "Associates a precomputed long range flare convolution file with a flare model file contained inside a litho model.");
MGCAddSnippet(74, "Loads a flare model into Calibre OPCverify. Used when the flare model is not in a litho model file.");
MGCAddSnippet(75, "Creates a definition block that describes how Calibre OPCverify adds gauges to a target layer. ");
MGCAddSnippet(76, "Creates a named option block containing settings for use with the image command in litho model mode.");
MGCAddSnippet(77, "Generates a group of image contours. Image sets and their auxiliary layers can be used to simplify setup file coding, and also enable some features.");
MGCAddSnippet(78, "Defines the contour image grid maximum size.");
MGCAddSnippet(79, "Declares a layer input to a Calibre OPCverify command file.");
MGCAddSnippet(80, "Specifies property names and property merge actions of an input layer.");
MGCAddSnippet(81, "Defines an inline litho model. Used for encrypted setup files only.");
MGCAddSnippet(82, "Controls the output of various diagnostic messages in the output log.");
MGCAddSnippet(83, "Optionally specifies the mask sampling grid. In most cases, the default setting (rsm) is sufficient.");
MGCAddSnippet(84, "Specifies the directories to search for optical and resist models.");
MGCAddSnippet(85, "Loads an optical model.  At least one optical_load_command must be present unless a litho model is loaded.");
MGCAddSnippet(86, "Overrides the default optical transform size setting.  This setup command is recommended for advanced users only, and can increase the simulation run time.");
MGCAddSnippet(87, "Outputs a context-sensitive clip around specified errors.");
MGCAddSnippet(88, "Sets the processing mode for Calibre OPCverify.");
MGCAddSnippet(89, "Toggles the reporting of cell processing information in the output log.");
MGCAddSnippet(90, "Promotes small slivers geometries out of frames.");
MGCAddSnippet(91, "Performs a light push on generated output layers. ");
MGCAddSnippet(92, "Modifies image set error markers with extra properties for errors in each component image (pw_image) of the image set.");
MGCAddSnippet(93, "Sets run options for the pw_annotate command.");
MGCAddSnippet(94, "Sets the rasterizer upsample factor relative to the optical (Nyquist) grid.");
MGCAddSnippet(95, "Loads a resist model into Calibre OPCverify.");
MGCAddSnippet(96, "Creates an output file containing the center points for error shapes. ");
MGCAddSnippet(97, "Creates and derives layers, depending on the options used. ");
MGCAddSnippet(98, "Loads a shadow bias model. Used when the shadow bias model is not contained in a litho model file.");
MGCAddSnippet(99, "Runs the deangler on all image contours.");
MGCAddSnippet(100, "Controls the aerial contour stairstep behavior.");
MGCAddSnippet(101, "Loads a stochastic model from the specified location.");
MGCAddSnippet(102, "Creates an HTML page containing summary information and snapshots of selected errors. Includes configuration output options for snapshots and histograms.");
MGCAddSnippet(103, "Imports a variable from the SVRF rule file.");
MGCAddSnippet(104, "Specifies the size of an Calibre OPCverify tile. ");
MGCAddSnippet(105, "Loads a topographical ( topo ) model into Calibre OPCverify.");
MGCAddSnippet(106, "Loads a zplanes model into Calibre OPCverify.");
MGCAddSnippet(107, "Calibre OPCverify uses setlayer options (sometimes referred to as setlayer operations, setlayer subcommands, or setlayer commands) to create and derive layers. ");
MGCAddSnippet(108, "An image operation performs optical and resist simulation using geometry on visible layers defined by the layer command, subject to the command options. ");
MGCAddSnippet(109, "The DRC-type operations are implemented for use with Calibre OPCverify setlayer commands. They must be entered in case-sensitive text.");
MGCAddSnippet(110, "The customized verification control operations are implemented for use with Calibre OPCverify setlayer commands. They must be entered in case-sensitive text.");
MGCAddSnippet(111, "All commands that create or modify layers are known as setlayer operations.");
MGCAddSnippet(112, "Performs a multi-layer AND of all inputs. ");
MGCAddSnippet(113, "Creates an annotated copy of a bridge, pinch, or area_overlay layer. ");
MGCAddSnippet(114, "Computes and checks the average printability analysis (APA) function value in relation to specified regions.");
MGCAddSnippet(115, "Checks area coverage. This command is mainly intended for contact layers.");
MGCAddSnippet(116, "Performs a contact alignment check, reporting possible shift issues.");
MGCAddSnippet(117, "Checks the area ratio of a shape versus a constraint.");
MGCAddSnippet(118, "Detects under-printing around ASRAF features.");
MGCAddSnippet(119, "Checks for tolerance band violations.");
MGCAddSnippet(120, "Checks for bridging conditions. ");
MGCAddSnippet(121, "Checks for outer tolerance band violations on a contour layer.");
MGCAddSnippet(122, "Generates a tolerance zone (outer or inner) around polygons on a layer.");
MGCAddSnippet(123, "Measures displacement from the centers of contour polygons to a corresponding target. ");
MGCAddSnippet(124, "Computes the circularity of layer shapes as a method to check contact areas.");
MGCAddSnippet(125, "Compares the difference between two contours.");
MGCAddSnippet(126, "Copies the specified layer to a new layer.");
MGCAddSnippet(127, "Chops convex and concave corners on polygon layers.");
MGCAddSnippet(128, "Checks if the radius of curvature for a specified layer (usually a curvilinear mask or an image) is larger than a user-specified value.");
MGCAddSnippet(129, "Tests the depth of focus value for multiple contours. Used for process window checks.");
MGCAddSnippet(130, "Creates an empty derived layer that can be output to SVRF or used in other operations. ");
