MGCAddSnippet(177, "This appendix is intended to be a rapid learning center for the Calibre OPCverify tool. It is separated into the following sections:");
MGCAddSnippet(178, "It is important that you learn the following techniques before setting up an Calibre OPCverify rule file.");
MGCAddSnippet(179, "Items in this section are practices that generally improve performance and reduce issues. These suggestions were contributed by experienced Calibre OPCverify users.");
MGCAddSnippet(180, "The pinch and bridge commands are intended for use with original drawn (target) layers as input. While the commands can accept post-bias adjusted layers, the additional jogs that typically exist on bias-adjusted layers can create associated jogs in the error markers. This may degrade Calibre OPCverify s classification capabilities on those markers, especially on input that use annotated constraints. ");
MGCAddSnippet(181, "The interact command is designed to test interactions between polygons. Use the extra_printing command to test for contours that print without a corresponding drawn polygon, since it is a faster command due to having a smaller max_extent size and supports concurrency with similar commands such as pinch, bridge, and not_printing. ");
MGCAddSnippet(182, "The interact command is designed to test interactions between polygons. Use the not_printing command to test for polygons that do not have a corresponding printing contour, since it is a faster command due to having a smaller max_extent size and supports concurrency such as pinch, bridge, and extra_printing. ");
MGCAddSnippet(183, "Choosing the wrong tile size can lead to performance and memory issues. ");
MGCAddSnippet(184, "Choosing the best grid settings is a balance between simulation consistency and runtime performance.");
MGCAddSnippet(185, "In the original version of Calibre OPCverify, detection of bridge and pinch errors was performed using a sequence of commands.");
MGCAddSnippet(186, "For the most efficient runtime, error review cycle, and smallest output data size, Siemens EDA strongly recommends that you use the  error-centric flow  (defined as the use of properties, classification, scoring, limiting and output window in the table following). ");
MGCAddSnippet(187, "critical_dimension is a setup command placed near the beginning of a Calibre OPCverify command file.");
MGCAddSnippet(188, "While it is possible to generate and run pinching and bridging operations on multiple contours at different process conditions, the contours of interest are only at the worst pinching and bridging locations. ");
MGCAddSnippet(189, "The output_window command is designed to report highly detailed information about errors.");
MGCAddSnippet(190, "Checks on non-nominal process window contours are expected to output a large number of errors. If these errors are sent to the output_window command, the contour layer generated around all the errors may increase runtime and memory usage. In these situations, use a classification and limit block in conjunction with the property block to reduce the number of errors.");
MGCAddSnippet(191, "Version 10 optical models include the symmetry information in the optical model. ");
MGCAddSnippet(192, "Use concurrency-based coding techniques to increase Calibre OPCverify processing efficiency. Similar commands that have a Concurrency Support section are run in the same calculation cycle, as long as they follow these guidelines: ");
MGCAddSnippet(193, "Calibre OPCverify command files are passed through the Tcl parser. It allows for looping and dynamic string construction.");
MGCAddSnippet(194, "Calibre OPCverify users who are creating layer-designated checks (poly, metal, or contact) should probably include the following kinds of verification checks depending on the layer type.");
MGCAddSnippet(195, "Where possible, you should apply a limit block, a classification block, or both on errors. This will reduce the size of the database that would otherwise be created with unclassified, non-limited properties.");
MGCAddSnippet(196, "When checking square contacts, create a separate filter layer containing cross shapes that cover the contacts such that each end of the cross extends across the middle of the edge of the square:");
MGCAddSnippet(197, "Whenever possible, use drawn target layers with the contour_diff command. ");
MGCAddSnippet(198, "Siemens EDA recommends the use of the direct_input tasks with litho-flat in situations where the design size is larger than the memory available on the primary host. ");
MGCAddSnippet(199, "The use of ULTRAflex versus TURBOflex is dependent on the situation and the software you are using. ");
MGCAddSnippet(200, "The following table summarizes common code problems seen in rule files submitted to Customer Support. ");
MGCAddSnippet(201, "Problem: Run time error,  Could not find output layer.  Sometimes results are written to an unintended layer.");
MGCAddSnippet(202, "Problem: Run time error. The DFM RDB command that writes to the ASCII RVE database file must be named differently than the derived layer from the LITHO OPCVERIFY call, since SVRF does not allow duplicate rule names within the same rule file.");
MGCAddSnippet(203, "Problem: The DRC PROPERTY and DRC CHECK MAP commands cannot write to the same output ASCII file. ");
MGCAddSnippet(204, "Problem: Syntax error, typically one of  something to do with unrecognized keyword  or  unexpected end of line .");
MGCAddSnippet(205, "Problem: Performance slowdowns or out-of-memory crashes due to multi-gigabyte output files. ");
MGCAddSnippet(206, "Problem: Performance slowdowns due to calculations required to size multiple polygon edges.");
MGCAddSnippet(207, "Problem: Performance slowdowns.");
MGCAddSnippet(208, "Problem: Missing expected data. The output_window command is designed to print detailed context clips to the output design file based around unique errors. Adding the classification block setting that keeps duplicates in addition to unique errors will result in the generation of many more errors than necessary to check errors.");
MGCAddSnippet(209, "Problem: Classification relies on finding identical matches of error markers. Using a post-opc or contour layer as the context layer for classification will result in a large number of unique errors due to various variations in the context layer shapes.");
MGCAddSnippet(210, "Key Concept: Errors are sorted during classification into three categories: ");
MGCAddSnippet(211, "Problem: Necking (soft pinch) errors are being detected as opens (hard pinch) errors when max_tolerance is set to a small value. This causes problems because max_tolerance is used as the search distance for nearby contours, and setting max_tolerance too small results in contours being missed.");
MGCAddSnippet(212, "Problem: A known SVRF practice is to combine multiple derived error layers together and then output the single combined error layer. However, this method does not work in Calibre OPCverify on layers that contain property values. While the shapes will be combined on the new layer, property values are not copied along with the shapes into the new output layer. ");
MGCAddSnippet(213, "Problem: Using output_window on a set of output layers that are or d together (such as to create a filter layer) loses classification and limiting results. Additionally, some error markers may contain contour shapes, which are not recommended for use with SVRF operations.");
MGCAddSnippet(214, "Problem: An output_window statement that uses the filter_only argument can cause unexpected errors in output layers if an empty_layer is not declared for use with the output_window layer. Furthermore, the empty_layer declaration must appear before the output_window statement that uses it.");
MGCAddSnippet(215, "A large halo size (greater than 1.0 microns, for example) should be avoided, as this will create a large interaction distance (unless filter_only is also specified), which in turn increases simulation runtime. Large filter layers are best created in SVRF after using the default value for halo (0.5 um) for output_window and sizing up the results. ");
MGCAddSnippet(216, "Problem: A single soft bridge or pinch error generates strange errors in the same location.");
MGCAddSnippet(217, "Problem: Additional unique errors appear in the database. This occurs in situations where the DFM RDB NOPSEUDO option was specified. The NOPSEUDO option flattens the hierarchy, creating new instances of geometries that may be classified as unique. It also increases runtime.");
MGCAddSnippet(218, "Problem: Non-45 degree geometries and possible inaccuracies.");
MGCAddSnippet(219, "Problem: Optical models created in versions 2005.1, 2005.2, 2005.3, and 2005.4 that include a generated .fsk file in the optical directory are missing information on diffusion and non-TCCS kernels. ");
MGCAddSnippet(220, "Problem: Using the window command on a check with a classify block does not return the expected output, because window is an older command that returns pre-classified errors rather than post-classified errors; in other words, it works on pre-classified, pre-limited results.");
MGCAddSnippet(221, "In order to select the most effective process settings, it is important to be able to  score  the overall performance of the layout through a process window.");
MGCAddSnippet(222, "The layout score for an individual process condition can be computed as:");
MGCAddSnippet(223, "Scoring failures allows you to rank all failures by their score, and thus prioritize what needs to be fixed. There is a exponential behavior of bridging and pinching with respect to dose at a fixed focus condition. This property can be used to help define a failure score for bridging and for pinching. ");
MGCAddSnippet(224, "After coding the calls to LITHO OPCVERIFY and any other output or derived layer calls you want to use, you can add one or more scoring functions in order to consolidate the various process results. ");
MGCAddSnippet(225, "When you generate an ASCII results file, you have the ability to use the more powerful Calibre RVE tool to inspect the results instead of using the RVE Viewing tool in Verification Center.");
MGCAddSnippet(226, "Follow this procedure to invoke and configure the Calibre RVE interface for use with Calibre OPCverify results. ");
MGCAddSnippet(227, "Since the ASCII results file contains a record of the properties in the rule file, you have multiple options on how to view the properties. ");
MGCAddSnippet(228, "In addition to histogram display, properties can also be viewed and sorted in tabular format. ");
MGCAddSnippet(229, "Histograms graphically display the frequency of specific data values. In the context of a Calibre OPCverify results database, this is the frequency of properties on a derived layer resulting from a specific operation. If multiple properties were generated, each property is attached to each instance of the error on the derived layer.");
MGCAddSnippet(230, "This appendix contains a heavily annotated source code listing of a typical Calibre OPCverify rule file.");
MGCAddSnippet(231, "The combined SVRF rule file and Calibre OPCverify command file represent some suggested checks for a metal1 layer. It generates simulated image contours for the metal1 and contact layer, and then performs critical dimension checks based on those contours. ");
MGCAddSnippet(232, "This appendix contains a heavily annotated source code listing of a typical Calibre OPCverify rule file.");
MGCAddSnippet(233, "The combined SVRF rule file and Calibre OPCverify command file create multiple process window image contours by varying the dose and defocus values on the loaded optical models. A number of commands that are used with process window contours are also included in the code.");
MGCAddSnippet(234, "Tcl Verification Format (TVF) is an enhancement to the Calibre Tools engine that allows Tcl programmers to implement Tcl as part of an SVRF rule file. Calibre OPCverify itself is a Tcl-based language, and therefore also supports Tcl intermixed with its commands. ");
MGCAddSnippet(235, "Similar to designating a text file as a shell script or HTML file, a single header command at the top of an SVRF rule file indicates to the Calibre engine that it should treat the file as a TVF file.");
MGCAddSnippet(236, "Since LITHO OPCVERIFY calls have the same basic structure, you can use a TVF loop to consolidate multiple calls into a single loop. This method can be used to easily expand the number of derived layers retrieved from a Calibre OPCverify file. ");
MGCAddSnippet(237, "While you could run the code  as is  at this point, this task demonstrates how to implement the matching image commands. ");
MGCAddSnippet(238, "Direct Data Entry (DDE) is run using various litho flat commands in Calibre OPCverify.");
MGCAddSnippet(239, "Using litho flat mode for Calibre OPCverify is an alternate method to quickly process flattened data with Calibre OPCverify commands. ");
MGCAddSnippet(240, "You will be bypassing the HDB engine with the use of a dummy file that is crafted to parallel the layers in the real target file. You may want to re-run a design more than once using different tile sizes until you find the best tilemicrons setting.");
MGCAddSnippet(241, "Certain DDE-specific key concepts may prove helpful in learning how to create litho flat rule files.");
MGCAddSnippet(242, "The DDE and litho flat flow requires the following tools:");
MGCAddSnippet(243, "The following table shows the tasks to implement litho flat rule files:");
MGCAddSnippet(244, "For full chip, you find the extent by loading a dummy file to the Calibre engine, and then reading the extent information directly from the actual intended design file.");
MGCAddSnippet(245, "The second step in the litho flat OPCverify flow is to start an SVRF rule file. This is a separate SVRF rule file that runs on the flat design file and conditions the data to work with Calibre OPCverify.");
MGCAddSnippet(246, "For processing purposes, the target file needs to be swapped with the dummy file.");
MGCAddSnippet(247, "Once you have created the header for the litho flat SVRF file, you must add relevant dummy layers and create an output window for the HDB engine to use as a template. You will be replacing these later in the Calibre OPCverify command file. ");
MGCAddSnippet(248, "The following sections contain code showing a full sample application.");
MGCAddSnippet(249, "Details on open source and third-party software that may be included with this product are available in the <your_software_installation_location>/legal directory.");

